import React, { Component } from 'react';
import { Link, withRouter } from "react-router-dom"

class Navbar extends Component {



    render() {
        return (
            <nav >
                <h1>Date-Nite</h1>
                <ul className="nav-links">
                    <Link to='/user'>
                        Profile
                    </Link>
                    <Link to="/locations">
                        Locations
                    </Link>
                    <Link to="/matches">
                        Matches
                    </Link>

                </ul>
            </nav>
        )
    }
}

export default Navbar
